import React from 'react';
import './Board.css';

function Cell (props) {

    const setBackground = {
        backgroundColor: props.cellColor
    }

    const handleClick = () => {
        console.log("clicked")
        console.log(props.key)
        props.paintCell(props.xCord, props.yCord)
    }

    return (
    <div onClick={handleClick} className="cell" style={setBackground}>

    </div>
    )

}

export default Cell;
